import React, { Component } from 'react';

class DateObj extends Component {

	constructor() {
		super()
		this.state = {
			clicked: false
		}
		this.selfClicked = this.selfClicked.bind(this)
	}

    static defaultProps = {
		day: "",
		date: null,
		unavailable: false
    }


	selfClicked(e) {
		this.props.dateClicked(e)
//	if(!this.props.unavailable) {
//			console.log(this.props.date)
//			this.setState({
//				clicked: !this.state.clicked 
//			})
//		}
	}

  render(){

	var styleDT = {
		backgroundColor:"black",
		color:"white"
	}
	var styleClicked = {
		backgroundColor: "green",
		color: "black"
	}
	var styleUnavailable = {
		backGroundcolor: "grey",
		color: "black"
	}

    if(this.props.dayToday) { //Highlight if TD, activities complete ot not 
      return(
        <td onClick={this.selfClicked} >{this.props.day}</td>
      )
    } else { 
      return(
        <td onClick={this.selfClicked}>{this.props.day}</td>
      )
    }
  }
}


export default DateObj;
